import React from 'react';
import "./footer.css"
import { Link } from 'react-router-dom';
function Footer() {
  return (
    <footer >
        <nav>
            <h3>Feedback</h3>
            <h3>GetNews</h3>

        <ul className="nav-list">
          <li><Link to="/">Church</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/contact">Contact</Link></li>
        </ul>
      </nav>    
      </footer>
  );
}

export default Footer;
